import "../css/header.css";

export function Header() {
  return (
    <div className="header">
      {" "}
      <span className="스마트배관공">스마트배관공</span>
      <div className="headerspace">
        <span>수동 관리</span>
        <span>위치 확인</span>
        <span>쓰레기 확인</span>
        <span>기록 확인</span>
      </div>
    </div>
  );
}
